ne immagine">
    <h1>Calcolo consumo<br><span class="centered">idrico</span></h1>
</div>

<!-- Primo intervallo -->
<div class="input-row">
    <div>
        <label for="startDate">Data iniziale:</label>
        <input type="date" id="startDate">
    </div>
    <div>
        <label for="reading1">Lettura iniziale:</label>
        <input type="number" id="reading1" placeholder="Inserisci lettura in m">
    </div>
</div>

<!-- Secondo intervallo -->
<div class="input-row">
    <div>
        <label for="endDate">Data finale:</label>
        <input type="date" id="endDate">
    </div>
    <div>
        <label for="reading2">Lettura finale:</label>
        <input type="number" id="reading2" placeholder="Inserisci lettura in m">
    </div>
</div>

<button id="calculateButton">Calcola consumo medio</button>

<h2 id="averageResult"></h2>

<!-- Campo per lettura presunta -->
<label for="thirdDate">Data per lettura presunta:</label>
<input type="date" id="thirdDate">

<!-- Pulsante Calcola Lettura Presunta -->
<button id="estimateButton">Calcola lettura presunta</button>

<h2 id="estimateResult"></h2>

<!-- Pulsante Reset -->
<button id="resetButton" style="font-size: small;">Reset</button>

<footer>
    <p>Realizzato da Christian Capuani - Versione 0.8 - 8 ottobre 2024</p>
</footer>

<script>
    document.getElementById('calculateButton').onclick = function() {
        const startDate = new Date(document.getElementById('startDate').value);
        const reading1 = parseFloat(document.getElementById('reading1').value);
        const endDate = new Date(document.getElementById('endDate').value);
        const reading2 = parseFloat(document.getElementById('reading2').value);

        if (isNaN(reading1) || isNaN(reading2) || startDate >= endDate) {
            document.getElementById('averageResult').innerText = 'Inserisci dati validi.';
            return;
        }

        // Calcolo giorni tra le due date
        const timeDifference = endDate - startDate;
        const daysDifference = timeDifference / (1000 * 3600 * 24);

        // Consumo medio in litri (1 m = 1000 litri)
        const totalConsumption = (reading2 - reading1) * 1000; // in litri
        const averageConsumption = Math.round(totalConsumption / daysDifference);

        document.getElementById('averageResult').innerText = `Consumo medio: ${averageConsumption} litri/giorno`;
    };

    document.getElementById('estimateButton').onclick = function() {
        const thirdDate = new Date(document.getElementById('thirdDate').value);
        const startDate = new Date(document.getElementById('startDate').value);
        const endDate = new Date(document.getElementById('endDate').value);
        const reading1 = parseFloat(document.getElementById('reading1').value);
        const reading2 = parseFloat(document.getElementById('reading2').value);

        if (isNaN(reading1) || isNaN(reading2) || startDate >= endDate || !thirdDate) {
            document.getElementById('estimateResult').innerText = 'Inserisci dati validi.';
            return;
        }

        // Calcolo consumo medio in litri/giorno
        const timeDifference = endDate - startDate;
        const daysDifference = timeDifference / (1000 * 3600 * 24);
        const averageConsumption = (reading2 - reading1) * 1000 / daysDifference; // litri/giorno

        // Calcolo lettura presunta per la data specificata
        const daysFromEnd = (thirdDate - endDate) / (1000 * 3600 * 24);
        const estimatedReading = reading2 * 1000 + (averageConsumption * daysFromEnd);

        document.getElementById('estimateResult').innerText = `Lettura presunta: ${Math.round(estimatedReading / 1000)} m`;
    };

    document.getElementById('resetButton').onclick = function() {
        document.getElementById('startDate').value = '';
        document.getElementById('reading1').value = '';
        document.getElementById('endDate').value = '';
        document.getElementById('reading2').value = '';
        document.getElementById('thirdDate').value = '';
        document.getElementById('averageResult').innerText = '';
        document.getElementById('estimateResult').innerText = '';
    };
</script>

</body>
</html>
